import React from "react";
// import {Navbar,Form,FormControl ,Nav} from "react-bootstrap";
import {Nav, Carousel,Form} from "react-bootstrap";
import './FNavbar.css';
function FNavbar() {
    return (
     
      <div className="FNavbar">
    <Nav className="mr-auto">
     </Nav>
   <Carousel>
      <Carousel.Item interval={1000}>
        <img
          className="d-block w-100"
          src="slid1.png"
          alt="First slide"
        />
      </Carousel.Item>
      <Carousel.Item interval={500}>
        <img
          className="d-block w-100"
          src="slid2.png"
          alt="Third slide"
        />
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src="slid3.png"
          alt="Third slide"
        />
      </Carousel.Item>
      </Carousel>
</div>

  );
}

export default FNavbar;
